// Card.js
import React from "react";
import "./Card.css";

function Card(props) {
  return (
    <div className="card">
      <h4 className="p1">{props.volume} ml</h4>
      <p className="p2">Rs.{props.Rupee}</p>
      <p className="p3">Save Rs.{props.Save}</p>
    </div>
  );
}

export default Card;
